import BookList from './BookList';

// Apollo Client setup
const client = new ApolloClient({
  uri: 'http://localhost:3000/graphql/'
});

class App extends Component {
  render() {
    return (
      <div id="main">
        <h1>Reading List</h1>
        <BookList />
      </div>
    );
  }
}

export default App;
